import profileImg from '../../assets/Images/Mohan-muruge.jpg';
import logo from '../../assets/Logo/Logo-brainflix.svg';
import searchIcon from '../../assets/Icons/Icon-search.svg';
import uploadIcon from '../../assets/Icons/Icon-upload.svg';
import searchData from '../../data/videos.json';
import { useState } from 'react';

export default function Header() {
    const [searchTerm, setSearchTerm] = useState('');
    return (
        <header>
            <div className="header__logo-container">
                <img src={logo} alt="brainflix logo" className="header__logo" />
            </div>
            <h1 className="header__title">BrainFlix</h1>
            <input
                type="text"
                placeholder="Search" onChange={event => {setSearchTerm(event.target.value)}}/>
            <button className="header__button"><img src={uploadIcon} alt="upload icon" className="header__icon" />upload</button>
            <div className="header__img-container">
                <img src={profileImg}alt="user profile default" className="header__img" />
            </div>
        </header>
    )
}
